ess data exporter or eraser.'=>'Данные могут быть экспортированы или удалены по запросу пользователей, используя Экспортировщик WordPress или Очиститель.','Registered user information is retained in your website’s database indefinitely.'=>'Информация о зарегистрированных пользователях сохраняется в базе данных вашего веб-сайта на неопределенный срок.','How long we retain your data'=>'Как долго мы сохраняем Ваши данные','You should include in your privacy policy what personal data is captured when someone submits/fills in one of the forms, why you collect it and what you do with this data and how long you keep it.'=>'Вы должны включить в вашу политику конфиденциальности, какие персональные данные записываются, когда кто-то отправляет/заполняет одну из форм, почему вы собираете ее и что вы делаете с этими данными и как долго вы храните их','Via these forms you are collecting personal data from your users.'=>'Через эти формы вы собираете персональные данные ваших пользователей.','%s provides you with forms for user registration, login and profiles.'=>'%s предоставляет вам формы регистрации, входа и профили','What personal data we collect and why we collect it'=>'Какие персональные данные мы собираем и зачем','Please confirm your acceptance of our privacy policy'=>'Просим подтвердить ваше согласие с нашей политикой приватности','Error Text'=>'Сообщение об ошибке','Please confirm that you agree to our privacy policy'=>'Просим подтвердить, что вы согласны с нашей политикой приватности','Checkbox agreement description'=>'Описание для флажка к соглашению','Hide privacy policy'=>'Скрыть политику приватности','Toggle Hide text'=>'Вкл\\выкл скрытие текста','Show privacy policy'=>'Показать политику приватности','Toggle Show text'=>'Вкл\\выкл показ текста','Content'=>'Содержимое','Enable on this form'=>'Включить на этой форме','Select page'=>'Выбрать страницу','Add New Field'=>'Добавить новое поле','Fields selected here will appear in the profile header area below the user\'s di