 upgrades</a> now.'=>'Лицензия достигла ее лимита активаций. <a href="%s">Просмотреть возможные обновления лицензии</a>','This appears to be an invalid license key for %s.'=>'Похоже, это неверный лицензионный ключ для %s. ','Your %1$s is not active for this URL. Please <a href="%2$s" target="_blank">visit your account page</a> to manage your license key URLs.'=>'Ваш %1$s не активен для этого URL. Пожалуйста, <a href="%2$s" target="_blank">перейдите на страницу своей учетной записи</a>, чтобы управлять URL-адресами лицензионного ключа.','Invalid license. Please <a href="%s" target="_blank">visit your account page</a> and verify it.'=>'Недействительная лицензия. Посетите <a href="%s" target="_blank">страницу Вашего аккаунта</a> и проверьте лицензию. ','Your license key has been disabled. Please <a href="%s" target="_blank">contact support</a> for more information.'=>'Ваш лицензионный ключ был отключен. Свяжитесь с <a href="%s" target="_blank">поддержкой</a> для получения дополнительной информации.','Your license key expired on %1$s. Please <a href="%2$s" target="_blank">renew your license key</a>.'=>'Срок действия вашего лицензионного ключа истек %1$s. <a href="%2$s" target="_blank">обновите лицензионный ключ</a>.','Ultimate Member - Settings'=>'Настройки плагина Ultimate Member','Check this box if you would like Ultimate Member to completely remove all of its data when the plugin/extensions are deleted.'=>'Установите этот флажок, если Вы хотите, чтобы плагин Ultimate Member полностью удалял все свои данные при удалении плагина/расширений.','Remove Data on Uninstall?'=>'Удалять данные при удалении плагина?','Select Default Cover Photo'=>'Выбрать фотографию обложки по умолчанию','Select Default Profile Photo'=>'Выбрать фотографию профиля по умолчанию','Other'=>'Прочее','Restricted Access Message'=>'Сообщение пользователям с ограниченным доступом','Restriction Content'=>'Ограничение содержания','Pages'=>'Страницы','%s page'=>'%s страница','Wrong Data'=>'Неправильные данные','Wrong Nonce'=>'Неверный одноразовый номер','<strong>%1$s</strong> future plans! Detailed future list is <a href="%2$s" target="_blank">here</a>'=>'<strong>%1$s</strong> планы на будущее! Подробный будущий список <a href="%2$s" target="_blank">здесь</a>','We\'re sorry to hear that. If you\'re having the issue with the plugin you can create a topic on our <a href="%s" target="_blank">support forum</a> and we will try and help you out with the issue. Alternatively if you have an idea on how we can make the plugin better or want to tell us what you don\'t like about the plugin you can tell us know by giving us feedback.'=>'Нам очень жаль это слышать. Если у Вас возникла проблема с плагином, Вы можете создать тему на нашем <a href="%s" target="_blank">форуме поддержки</a>, и мы постараемся помочь с этой проблемой. В качестве альтернативы, если у Вас есть идея, как мы можем улучшить плагин, или Вы хотите рассказать нам, что не нравится в плагине, Вы можете сообщить нам об этом, оставив отзыв.','Provide Feedback'=>'Оставить отзыв','We\'re glad to hear that you like the plugin but we would love to get your feedback so we can make the plugin better.'=>'Мы рады услышать, что Вам нравится этот плагин, но мы хотели бы получить Ваши отзывы, чтобы мы могли улучшить его.','Leave Review'=>'Оставить отзыв','Great! We\'re happy to hear that you love the plugin. It would be amazing if you could let others know why you like %s by leaving a review of the plugin. This will help %s to grow and become more popular and would be massively appreciated by us!'=>'Великолепно! Мы рады услышать, что Вам нравится этот плагин. Было бы замечательно, если бы Вы могли рассказать другим, почему вам нравится %s, оставив отзыв о плагине. Это поможет улучшить %s и стать более популярным, мы будем очень признательны!','I don\'t like the plugin'=>'Мне не нравится плагин','It\'s good but could be better'=>'Неплохо, но могло быть и лучше','I love it!'=>'Мне нравится!','Hey there! It\'s been one month since you installed %s. How have you found the plugin so far?'=>'Привет всем! С момента установки %s прошел месяц. Как Вам понравился плагин?','<strong>%1$s %2$s</strong> Successfully Upgraded'=>'<strong>%1$s %2$s</strong> Успешно обновлен','You have %1$s invalid or expired license keys for %2$s. Please go to the <a href="%3$s">Licenses page</a> to correct this issue.'=>'У вас есть %1$s недействительных или просроченных лицензионных ключей для %2$s. Пожалуйста, перейдите на страницу <a href="%3$s">Лицензии</a>, чтобы исправить эту проблему.','There are %1$s inactive %2$s license keys for this site. This site is not authorized to get plugin updates. You can active this site on <a href="%3$s">www.ultimatemember.com</a>.'=>'У этого сайта есть %1$s неактивных лицензионных ключей для %2$s. Этот сайт не имеет разрешения на получение обновлений плагина. Вы можете активировать этот сайт на <a href="%3$s">www.ultimatemember.com</a>.','No thanks'=>'Нет, спасибо','You have installed <strong>%s</strong> with wrong folder name. Correct folder name is <strong>"ultimate-member"</strong>.'=>'Вы установили <strong>%s</strong> с неправильным именем папки. Правильное имя папки <strong>"ultimate-member"</strong>.','Try again later. You can run this action once daily.'=>'Попробуйте позже. Вы можете запускать это действие один раз в день.','<strong>%1$s %2$s</strong> requires 2.0 extensions. You have pre 2.0 extensions installed on your site. <br /> Please update %3$s extensions to latest versions. For more info see this <a href="%4$s" target="_blank">doc</a>.'=>'<strong>%1$s %2$s</strong> требует расширения версии 2.0. У вас установлены расширения предыдущей версии 2.0 на вашем сайте. <br /> Пожалуйста, обновите расширения %3$s до последних версий. Дополнительную информацию смотрите в этом <a href="%4$s" target="_blank">документе</a>.','No Selected'=>'Не выбрано','Dynamically populates the option based from selected parent option.'=>'Динамически заполняет параметр на основе выбранного родительского параметра.','Parent Option'=>'Родительский параметр','Add a callback source to retrieve choices.'=>'Для получения вариантов выбора, укажите данные обратного звонка.','Choose whether you want a 5-stars or 10-stars ratings based here.'=>'Укажите здесь рейтинг, который составляет 5 или 10 звезд.','This option allows you to set whether the field must be filled in before the form can be processed.'=>'Этот параметр позволяет указать, нужно ли заполнять поле перед обработкой формы.','Select the member roles that can view this field on the front-end.'=>'Выбрать роли участников, которые могут просматривать это поле в части сайта для посетителей.','Field privacy allows you to select who can view this field on the front-end. The site admin can view all fields regardless of the option set here.'=>'Конфиденциальность поля позволяет Вам выбрать, кто может просматривать это поле в интерфейсе пользователя. Администратор сайта может просматривать все поля независимо от установленной здесь опции.','This is the text that appears within the field e.g please enter your email address. Leave blank to not show any placeholder text.'=>'Это текст, который появляется в поле, например, "введите свой адрес электронной почты". Оставьте поле пустым, чтобы текст-заполнитель не отображался.','The field label is the text that appears above the field on your front-end form. Leave blank to not show a label above field.'=>'Метка поля - это текст, который отображается над полем в вашей внешней форме. Оставьте поле пустым, чтобы не отображать метку над полем.','This option allows you to pre-fill the field with a default value prior to the user entering a value in the field. Leave blank to have no default value'=>'Этот параметр позволяет предварительно заполнить поле значением по умолчанию до того, как пользователь введет значение в поле. Оставьте поле пустым, чтобы не указывать значение по умолчанию','If you wish the rating field to be prefilled with a number of stars, enter it here.'=>'Если Вы хотите, чтобы поле рейтинга было предварительно заполнено числом звезд, укажите его здесь.','Text to display by default in this field'=>'Текст для отображения по умолчанию в данном поле','This is the text that appears in a tooltip when a user hovers over the info icon. Help text is useful for providing users with more information about what they should enter in the field. Leave blank if no help text is needed for field.'=>'Это текст, который появляется во всплывающей подсказке, когда пользователь наводит курсор на значок информации. Текст справки полезен для предоставления пользователям дополнительной информации о том, что им следует ввести в поле. Оставьте поле пустым, если текст справки для поля не требуется.','A meta key is required to store the entered info in this field in the database. The meta key should be unique to this field and be written in lowercase with an underscore ( _ ) separating words e.g country_list or job_title'=>'Мета-ключ необходим для хранения введенной в этом поле информации в базе данных. Мета-ключ должен быть уникальным для этого поля и быть написан строчными буквами с разделяющим слова подчеркиванием (_), например, country_list или job_title','The meta key cannot be changed for duplicated fields or when editing an existing field. If you require a different meta key please create a new field.'=>'Мета-ключ нельзя изменить для дублированных полей или при редактировании существующего поля. Если Вам нужен другой мета-ключ, создайте новое поле.','This is the title of the field for your reference in the backend. The title will not appear on the front-end of your website.'=>'Это заголовок поля для справки в серверной части. Заголовок не будет отображаться в интерфейсе вашего веб-сайта.','Enter one choice per line. This will represent the available choices or selections available for user.'=>'Укажите по одному варианту в каждой строке. Это будет представлять доступные варианты или доступные пользователю варианты.','Turn on/off HTML tags for this textarea'=>'Включить/выключить HTML-теги для данного текстового поля','If you want to enable a maximum number of characters to be input in this field. Leave empty to disable this setting'=>'Если Вы хотите разрешить ввод максимального количества символов в это поле. Оставьте поле пустым, чтобы отключить данный параметр','If you want to enable a minimum number of characters to be input in this field. Leave empty to disable this setting'=>'Если Вы хотите разрешить ввод минимального количества символов в это поле. Оставьте поле пустым, чтобы отключить данный параметр','If you want to enable a maximum number of words to be input in this textarea. Leave empty to disable this setting'=>'Если Вы хотите включить максимальное количество слов для ввода в это текстовое поле. Оставьте поле пустым, чтобы отключить данный параметр','This is the max number of entries the user can add via field group.'=>'Это максимальное количество записей, которое пользователь может добавить в группу полей.','Enter a number here to force a minimum number of selections by user for this field'=>'Укажите здесь число, чтобы установить минимальное количество вариантов выбора пользователем для этого поля','Enter a number here to force a maximum number of selections by user for this field'=>'Укажите здесь число, чтобы установить максимальное количество вариантов выбора пользователем для этого поля','Enable/disable multiple selections for this field'=>'Включение/отключение множественного выбора для данного поля','This is the required spacing in pixels. e.g. 20px'=>'Это необходимый интервал в пикселях, например, 20 пикселей','The height of textarea in pixels. Default is 100 pixels'=>'Высота текстового поля в пикселях. По умолчанию 100 пикселей','The maximum size for image that can be uploaded through this field. Leave empty for unlimited size.'=>'Максимальный размер изображения, которое можно загрузить через это поле. Оставьте поле пустым для неограниченного размера.','The text that appears on the button. e.g. Upload'=>'Текст, который появляется на кнопке например, Загрузить','If you need to add information or secondary line below the headline of upload box, enter it here'=>'Если Вам нужно добавить информацию или дополнительную строку под заголовком окна загрузки, укажите это здесь','This is the headline that appears in the upload box for this field'=>'Это заголовок, который появляется в поле загрузки данного поля','Select the image types that you want to allow to be uploaded via this field.'=>'Укажите типы изображений, которые Вы хотите разрешить для загрузки через это поле.','Enable/disable crop feature for this image upload and define ratio'=>'Включение/отключение функции кадрирования для загрузки изображения и определение соотношения сторон','Edit the content of this field here'=>'Отредактируйте здесь содержимое данного поля','Enter the shortcode in the following textarea and it will be displayed on the fields'=>'Введите шорткод в следующее текстовое поле, и он будет отображаться в полях','Whether to show a specific number of years or specify a date range to be available for the date picker.'=>'Показывать определенное количество лет или указать диапазон, который будет доступен для выбора даты.','Set the maximum date/day in range in the format YYYY/MM/DD'=>'Установить максимальный диапазон дата/день в формате ГГГГ/ММ/ДД','Set the minimum date/day in range in the format YYYY/MM/DD'=>'Установить минимальный диапазон дата/день в формате ГГГГ/ММ/ДД','This decides which years should be shown relative to today date'=>'Это определяет, какие годы следует отображать относительно сегодняшней даты','Number of years available for the date selection. Default to last 50 years'=>'Количество лет, доступных для выбора даты. Срок по умолчанию составляет 50 лет','Disable specific week days from being available for selection in this date picker'=>'Отключить определенные дня недели для выбора в этом средстве выбора даты','Whether you wish to show the date in full or only show the years e.g. 25 Years'=>'Если Вы хотите показать дату полностью или только годы, например, 25 лет','Choose the displayed time-format for this field'=>'Выбрать отображаемый формат времени для этого поля','The display format of the date which is visible to user.'=>'Формат отображения даты, видимой пользователю.','Choose the minutes interval between each time in the time picker.'=>'Указать период интервала в минутах, отображаемый в окне выбора времени.','This is the line-style of divider'=>'Это стиль линии разделителя','Whether to follow or nofollow this link by search engines'=>'Следует ли переходить по этой ссылке поисковым системам','Choose whether to open this link in same window or in a new window'=>'Укажите, открывать эту ссылку в том же окне или в новом','Entering custom text here will replace the url with a text link'=>'Если ввести здесь пользовательский текст, вместо URL будет текстовая ссылка','Select a color for this divider'=>'Выбрать цвет для этого разделителя','This will be the color of selected icon. By default It will be the same color as heading text color'=>'Это будет цвет выбранной иконки. По умолчанию он будет того же цвета, что и цвет текста заголовка','This will be the text color of entire section'=>'Это будет цвет текста всего раздела','This will be the text color of heading part only'=>'Это будет цвет текста только части заголовка','This will be the background of the heading section'=>'Это будет цвет фона заголовка раздела','This will be the background of entire section'=>'Это будет фоном всего раздела','Enter the row heading text here'=>'Укажите здесь текст заголовка строки','Whether to enable a heading for this row'=>'Включать ли заголовок для этой строки','Enable Row Heading'=>'Включить заголовок строки','Give a color to this border'=>'Укажите цвет границы','Rounded corners can be applied by setting a pixels value here. e.g. 5px'=>'Применить скругленные углы, указав здесь значение в пикселях, например, 5 пикселей','Choose the border style'=>'Выбрать стиль границы','Set border for this section'=>'Установить границу для данного раздела','Set margin for this section'=>'Установить внешний отступ для данного раздела','Set padding for this section'=>'Установить внутренний отступ для данного раздела','This is the width in pixels, e.g. 4 or 2, etc'=>'Это ширина в пикселях, например, 4 или 2 и т.д.','Specify a custom CSS class to be applied to this element'=>'Укажите собственный класс CSS, который будет применяться к этому элементу','Select an icon to appear in the field. Leave blank if you do not want an icon to show in the field.'=>'Укажите иконку, которая будет отображаться в поле. Оставьте поле пустым, если не хотите, чтобы в поле отображалась иконка.','If you want to apply your custom validation, you can use action hooks to add custom validation. Please refer to documentation for further details.'=>'Если Вы хотите применить свою настраиваемую проверку, можете использовать хуки действий, чтобы добавить настраиваемую проверку. Пожалуйста, обратитесь к документации для получения дополнительной информации.','Does this field require a special validation'=>'Требует ли данное поле специальной проверки','WP Capabilities'=>'Возможности WP','Publish'=>'Опубликовать','Hide from queries'=>'Скрыть от запросов','Where should users be redirected to?'=>'Куда следует перенаправлять пользователей?','Custom message'=>'Пользовательское сообщение','Redirect user'=>'Перенаправить пользователя','Show access restricted message'=>'Показать сообщение об ограничении доступа','Action when users without access tries to view the post'=>'Действие, когда пользователи без доступа пытаются просмотреть запись','Select which roles can access this post'=>'Установите полный URL куда вы хотите перенаправлять пользователя','Logged in users'=>'Авторизованные пользователи','Logged out users'=>'Пользователи, вышедшие из системы','Upgrade\'s Manual Request'=>'Запрос на обновление вручную','If you like Ultimate Member please consider leaving a %s review. I